// src/components/MapInfo.js
import React from 'react';

const MapInfo = () => {
    return (
    <div>
        <h2>지도</h2>
        <p>지도 탭입니다. 여기에 위치 정보나 지도가 표시될 수 있습니다.</p>
    </div>
    );
};

export default MapInfo;
